import React from 'react'
import './clusterMessage.component.scss'
import Button from '../button/button.component'
import { motion } from "framer-motion"

export default function ClusterMessage(props) {
    const variants = {
        initial: { opacity: 0, y: 100 },
        actual: { opacity: 1, y: 0 },
        transition: { 
            ease: "easeOut", 
            when: "beforeChildren",
            staggerChildren: 0.5 
        }
    }

    return (
        <motion.div className="cluster-message" style={props.style} initial="initial" animate="actual" variants={variants}>
            <h1>materiale de contructii, gradinarit & bricolaj</h1>
            <p initial="initial">Nu ai gasit ce cautai?</p>
            <p initial="initial">Preluam si comenzi speciale</p>
            <p initial="initial">Apeleaza-ne la 0732 409 095</p>
            <Button/>
        </motion.div>
    )
}
